import React from "react";
import { Container, Table } from "react-bootstrap";
import "./style.css";
const App = () => {
  const students = [
    { name: "waliullah", email: "waliullag@gmail.com", contact: "111",address:[
      {thana:'Galacipa',district:'Patuakhali',country:'Bangladesh'}
    ] },
    { name: "Habiba", email: "Habiba@gmail.com", contact:" 2646464",address:[
      {thana:'koler pukur par',district:'Patuakhali',country:'Bangladesh'}
    ] },
    { name: "Ayesha", email: "Ayesha@gmail.com", contact: '11154554',address:[
      {thana:'Dumki',district:'Patuakhali',country:'Bangladesh'}
    ] },
    { name: "Fatima", email: "Fatima@gmail.com", contact: '1742572220 ',address:[
      {thana:'Dumki',district:'Patuakhali',country:'Bangladesh'}
    ]},
    { name: "Setara", email: "Setara@gmail.com", contact:'111',address:[
      {thana:'Patukhali',district:'Patuakhali',country:'Bangladesh'}
    ]},
  ];

  return (
    <>
      <Container className="text-center">
        <h2> Handle Array With List</h2>

        <Table striped bordered hover variant='dark'>
          <thead>
            <tr>
            <th> #ID</th>
              <th> Name</th>
              <th>Email</th>
              <th>Contact</th>
              <th>Address</th>
            </tr>
          </thead>
          <tbody>
            {students.map((data,i) => (


              <tr key={i}>
                <td>{i+1}</td>
                <td>{data.name}</td>
                <td>{data.email}</td>
                <td>{data.contact}</td>
                <td>

                <Table striped bordered hover variant='dark'>
                       <thead>
                         <tr>
                         <th> #ID</th>
                           <th> Thana</th>
                           <th>District</th>
                           <th>Country</th>

                         </tr>
                       </thead>
                       <tbody>
                  {

                  data.address.map((item)=>
                  <tr>
                  <td>{i+1}</td>
                  <td>{item.thana}</td>
                  <td>{item.district}</td>
                  <td>{item.country}</td>
                  </tr>
                  )}
                   </tbody>
                   </Table>

                  </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </Container>
    </>
  );
};

export default App;
